description:
The film consists of 6 loosely tied together scenes which center around redhead Leena in the role of Suzy trying a series of different jobs in order to make ends meet.
By the film's end, we see Leena as an assistant on two different porn sets, a nursing assistant to a doctor, line coach for a TV evangelist and a construction worker.


